import React, { useEffect } from 'react'
import { useSelector } from 'react-redux'

function UserAvatar({ profilePic, name }) {
  
    return (
        <div>
            <h3>{name}</h3>
            <Avatar sx={{ height: 40, width: 40 }} src={profilePic ? profilePic.url : ''} />
        </div>
    )
}

